import React from 'react';

const Posts = ({posts}) => {
    return <div>
        <h1>Posts</h1>
        {
            posts.map(post => <div key={post._id}>
                <h3>Title: {post.title}</h3>
                <div>Price: {post.price}</div>
            </div>
            )
        }
    </div>
}

export default Posts;
